import React from 'react';

const MainContent = () => {
  return (
    <div className="main-content" id="dashboard" style={{ flex: 1, padding: '20px', backgroundColor: '#fff', overflowY: 'auto', height: '100%' }}>
      <div className="header" style={{ backgroundColor: '#ffc107', color: '#fff', padding: '30px', borderRadius: '10px', marginBottom: '30px' }}>
        <h2 style={{ margin: 0, fontSize: '24px' }}>Get Discount Voucher Up To 20%</h2>
        <p style={{ marginTop: '10px', fontSize: '16px' }}>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt.</p>
      </div>
      <div className="popular-dishes">
        <h3 style={{ marginBottom: '20px', fontSize: '20px' }}>Popular Dishes</h3>
        <div className="dishes" style={{ display: 'flex', flexWrap: 'wrap', gap: '20px' }}>
          {[
            { name: 'Fish Burger', price: '$4.50', img: '/resources/fish-burger.jpg' },
            { name: 'Beef Burger', price: '$5.59', img: '/Resources/beef-burger.jpg' },
            { name: 'Grilled Chicken', price: '$3.99', img: '/Resources/chicken-burger.jpg' },
            { name: 'Tower Burger', price: '$24.99', img: '/Resources/tower-burger.jpg' },
            { name: 'Grilled Chicken', price: '$7.99', img: '/Resources/grilled-chicken.jpg' },
            { name: 'Orange Chicken', price: '$6.99', img: '/Resources/orange-chicken.jpg' },
            { name: 'Thandoori Chicken', price: '$5.49', img: '/Resources/tandoori-chicken.jpg' },
            { name: 'Teriyaki Chicken', price: '$5.99', img: '/Resources/chicken-teriyaki.jpg' }
          ].map((dish, index) => (
            <div key={index} className="dish" data-category="burger" style={{ backgroundColor: '#f1f1f1', padding: '20px', textAlign: 'center', borderRadius: '10px', width: 'calc(25% - 20px)', height: '450px', boxSizing: 'border-box', position: 'relative' }}>
              <div className="badge" style={{ position: 'absolute', top: '-10px', left: '-10px', backgroundColor: '#e74c3c', color: '#fff', padding: '5px 10px', borderRadius: '5px' }}>15% Off</div>
              <img src={dish.img} alt={dish.name} style={{ width: '100%', height: '50%', objectFit: 'cover', borderRadius: '10px' }} />
              <h4 style={{ fontSize: '18px' }}>{dish.name}</h4>
              <p style={{ fontSize: '16px', color: '#e74c3c' }}>{dish.price}</p>
              <label htmlFor="quantity" style={{ display: 'block', marginBottom: '5px', fontSize: '14px', color: '#555' }}>Quantity:</label>
              <input type="number" id="quantity" defaultValue="1" min="1" style={{ width: '60px', padding: '5px', marginBottom: '15px', borderRadius: '5px', border: '1px solid #ccc' }} />
              <button style={{ backgroundColor: '#c0392b', color: '#fff', border: 'none', borderRadius: '5px', padding: '10px 20px', cursor: 'pointer', fontSize: '16px', width: '100%' }}>Add to Cart</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default MainContent;
